import React from 'react';

function Header (){
    return  <header>
              <img className="head-img" src="https://rigelselmani.github.io/Word-Scape/assets/images/logo%20(2).png" alt="word-img"/>
              <ul>
                
                  <li>Home</li>
               
                
                  <li>Word &#8226; Bank</li>
              
           
                  <li>Practice!</li>
              
              </ul>
              </header>
}

export default Header;
